void plotNumbers09(int x, int y, int userChoice) {
	int xPlot, yPlot;
	for (xPlot = x; xPlot <= x + 20; xPlot++) {
		for (yPlot = y; yPlot <= y + 20; yPlot++) {
			plotPixel(xPlot, yPlot, 0x0000);
		}
	}
	if (userChoice == 0) {
		drawVerticalLine(x, y, 20, 0xFFFF);
		drawHorizontalLine(x, y, 10, 0xFFFF);
		drawHorizontalLine(x, y + 20, 10, 0xFFFF);
		drawVerticalLine(x + 10, y, 20, 0xFFFF);
	}
	if (userChoice == 1) {
		drawHorizontalLine(x + 5, y, 5, 0xFFFF);
		drawVerticalLine(x + 10, y, 20, 0xFFFF);
		drawHorizontalLine(x + 5, y + 20, 10, 0xFFFF);
	}
	if (userChoice == 2) {
		drawHorizontalLine(x, y, 10, 0xFFFF);
		drawVerticalLine(x + 10, y, 10, 0xFFFF);
		drawHorizontalLine(x, y + 10, 10, 0xFFFF);
		drawVerticalLine(x, y + 10, 10, 0xFFFF);
		drawHorizontalLine(x, y + 20, 10, 0xFFFF);
	}
	if (userChoice == 3) {
		drawHorizontalLine(x, y, 10, 0xFFFF);
		drawVerticalLine(x + 10, y, 10, 0xFFFF);
		drawHorizontalLine(x, y + 10, 10, 0xFFFF);
		drawVerticalLine(x + 10, y + 10, 10, 0xFFFF);
		drawHorizontalLine(x, y + 20, 10, 0xFFFF);
	}
	if (userChoice == 4) {
		drawVerticalLine(x, y, 10, 0xFFFF);
		drawVerticalLine(x + 10, y, 10, 0xFFFF);
		drawHorizontalLine(x, y + 10, 10, 0xFFFF);
		drawVerticalLine(x + 10, y + 10, 10, 0xFFFF);
	}
	if (userChoice == 5) {
		drawHorizontalLine(x, y, 10, 0xFFFF);
		drawVerticalLine(x, y, 10, 0xFFFF);
		drawHorizontalLine(x, y + 10, 10, 0xFFFF);
		drawVerticalLine(x + 10, y + 10, 10, 0xFFFF);
		drawHorizontalLine(x, y + 20, 10, 0xFFFF);
	}
	if (userChoice == 6) {
		drawHorizontalLine(x, y, 10, 0xFFFF);
		drawVerticalLine(x, y, 20, 0xFFFF);
		drawHorizontalLine(x, y + 10, 10, 0xFFFF);
		drawVerticalLine(x + 10, y + 10, 10, 0xFFFF);
		drawHorizontalLine(x, y + 20, 10, 0xFFFF);
	}
	if (userChoice == 7) {
		drawHorizontalLine(x, y, 10, 0xFFFF);
		drawVerticalLine(x + 10, y, 20, 0xFFFF);
	}
	if (userChoice == 8) {
		drawHorizontalLine(x, y, 10, 0xFFFF);
		drawVerticalLine(x, y, 20, 0xFFFF);
		drawHorizontalLine(x, y + 10, 10, 0xFFFF);
		drawVerticalLine(x + 10, y, 20, 0xFFFF);
		drawHorizontalLine(x, y + 20, 10, 0xFFFF);
	}
	if (userChoice == 9) {
		drawHorizontalLine(x, y, 10, 0xFFFF);
		drawVerticalLine(x, y, 10, 0xFFFF);
		drawHorizontalLine(x, y + 10, 10, 0xFFFF);
		drawVerticalLine(x + 10, y, 20, 0xFFFF);
		drawHorizontalLine(x, y + 20, 10, 0xFFFF);
	}
}

void drawHorizontalLine(int x, int y, int length, short int lineColor) {
	int xPlot;
	for (xPlot = x; xPlot <= x + length; xPlot++) {
		plotPixel(xPlot, y, lineColor);
	}
}

void drawVerticalLine(int x, int y, int length, short int lineColor) {
	int yPlot;
	for (yPlot = y; yPlot <= y + length; yPlot++) {
		plotPixel(x, yPlot, lineColor);
	}
}

void plotPixel(int x, int y, short int lineColor) {
	*(short int*)(startOfPixelBuffer + (y << 10) + (x << 1)) = lineColor;
}